import React from 'react';
import { Article, Brand, Navbar, Feature, CTA } from './components';
import { Footer, Blog, Possibility, Features, WhatGPT3, Header} from './containers'
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='gradient__bg'>
        <Navbar />
        <Header />
      </div>
      <Brand />
      <Article />
      <CTA />
      <Feature />
    </div>
  );
}

export default App;
